// Firebase Configuration for Village Auto Connect
import { initializeApp } from 'firebase/app';
import { getAuth, GoogleAuthProvider } from 'firebase/auth';

// Firebase config (For demo purposes - replace with your actual config)
const firebaseConfig = {
  apiKey: "AIzaSyDemoApiKey-replace-with-your-key",
  authDomain: "village-auto-connect-demo.firebaseapp.com",
  projectId: "village-auto-connect-demo",
  storageBucket: "village-auto-connect-demo.appspot.com",
  messagingSenderId: "123456789012",
  appId: "1:123456789012:web:abcdefghijklmnop"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize Firebase Authentication and get a reference to the service
export const auth = getAuth(app);

// Initialize Google Auth Provider
export const googleProvider = new GoogleAuthProvider();

// Configure Google Provider
googleProvider.setCustomParameters({
  prompt: 'select_account'
});

export default app;
